css:
.editor-colors {
  background-color: #0e151b;
  color: #f8f8f2;
}
.editor .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
.editor .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
.editor .gutter {
  background-color: #131d25;
  color: #3c4c5f;
}
.editor .gutter .line-number.cursor-line {
  background-color: #7bb9ed;
  color: #3c4c5f;
}
.editor .gutter .line-number.cursor-line-no-selection {
  background-color: #7bb9ed;
  color: #3c4c5f;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #3c4c5f;
}
.editor .invisible {
  color: #f8f8f2;
}
.editor .cursor {
  border-color: #f8f8f0;
}
.editor .selection .region {
  background-color: #3125b0;
  border: 1px solid #A1A1FF;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #a6f2d7;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #000000;
}
.editor .comment {
  color: #60676d;
}
.editor .string {
  color: #59f046;
}
.editor .constant.numeric {
  color: #AE81FF;
}
.editor .constant.language {
  color: #AE81FF;
}
.editor .constant.character,
.editor .constant.other {
  color: #AE81FF;
}
.editor .keyword {
  color: #EA1930;
}
.editor .storage {
  color: #F92672;
}
.editor .storage.type {
  font-style: italic;
  color: #5eebb8;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #3cadd7;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #3cadd7;
}
.editor .entity.name.function {
  color: #3cadd7;
}
.editor .entity.name.instance {
  color: #5eebb8;
}
.editor .variable.parameter {
  font-style: italic;
  color: #5eebb8;
}
.editor .entity.name.tag {
  color: #F92672;
}
.editor .entity.other.attribute-name {
  color: #3cadd7;
}
.editor .support.function {
  color: #5eebb8;
}
.editor .support.constant {
  color: #5eebb8;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #5eebb8;
}
.editor .invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.editor .class.jade {
  color: #AE81FF;
}
.editor .gfm .markup.heading {
  color: #3cadd7;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #59f046;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #5eebb8;
}
.editor .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
.editor .gfm .link {
  color: #CCC;
}
.editor .gfm .link .entity {
  color: #AE81FF;
}
